// RoleSelectionPage.js
import React from 'react';

const RoleSelectionPage = ({ onSelectRole }) => {
  const handleRoleSelect = (role) => {
    onSelectRole(role);
  };

  return (
    <div>
      <h2>Select Your Role</h2>
      <button onClick={() => handleRoleSelect('student')}>Student</button>
      <button onClick={() => handleRoleSelect('coordinator')}>Project Coordinator</button>
      <button onClick={() => handleRoleSelect('member')}>Project Member</button>
      <button onClick={() => handleRoleSelect('examiner')}>Examiner</button>
      <button onClick={() => handleRoleSelect('supervisor')}>Supervisor</button>
      <button onClick={() => handleRoleSelect('co-supervisor')}>Co-supervisor</button>
    </div>
  );
};

export default RoleSelectionPage;
